var title_f25_1_25623="Left atrial myxoma TTE TEE I";
var content_f25_1_25623=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F60232%7ECARD%2F68725&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F60232%7ECARD%2F68725&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 482px\">",
"   <div class=\"ttl\">",
"    Left atrial myxoma on transthoracic and transesophageal echocardiography",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 462px; height: 253px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    A four chamber view from a transthoracic echocardiography (panel A) suggests a well encapsulated mass within the left atrium (arrow). The consistence is fairly uniform although there may be a few rarefactions. Transesophageal echocardiography (panel B) shows the details of the tumor attachment to the lower limbus of the foraminal portion of the interatrial septum. The implied irregularity on transthoracic echocardiography are clearly seen cysts that are also typical of these tumors.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Left atrial myxoma",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 371px; height: 277px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The long axis precordial view from a transthoracic echocardiography shows the tumor as a vague mass just behind the aortic root (panel A). The apical four chamber view (panel B) shows the mass attached to the interatrial septum. A transesophageal echocardiography (panels C and D) reveals that the myxoma is highly mobile and at surgery, the tumor had the consistency of jelly and fragmented easily.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
