var title_f25_1_25627="Acute porphyrias features";
var content_f25_1_25627=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F51032&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F51032&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Comparison of the major features of the four acute porphyrias",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\">",
"       &nbsp;",
"      </td>",
"      <td class=\"subtitle1\">",
"       Deficient enzyme (sequence in pathway)",
"      </td>",
"      <td class=\"subtitle1\">",
"       Inheritance",
"      </td>",
"      <td class=\"subtitle1\">",
"       Neurological manifestations",
"      </td>",
"      <td class=\"subtitle1\">",
"       Blistering skin lesions",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       ALA dehydratase porphyria (ADP)",
"      </td>",
"      <td>",
"       ALA dehydratase (2)",
"      </td>",
"      <td>",
"       Autosomal recessive",
"      </td>",
"      <td>",
"       Yes",
"      </td>",
"      <td>",
"       No",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Acute intermittent porphyria (AIP)",
"      </td>",
"      <td>",
"       PBG deaminase (3)",
"      </td>",
"      <td>",
"       Autosomal dominant",
"      </td>",
"      <td>",
"       Yes",
"      </td>",
"      <td>",
"       No",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Hereditary coproporphyria (HCP)",
"      </td>",
"      <td>",
"       Coproporphyrinogen oxidase (6)",
"      </td>",
"      <td>",
"       Autosomal dominant",
"      </td>",
"      <td>",
"       Yes",
"      </td>",
"      <td>",
"       Uncommon",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Variegate porphyria (VP)",
"      </td>",
"      <td>",
"       Protoporphyrinogen oxidase (7)",
"      </td>",
"      <td>",
"       Autosomal dominant",
"      </td>",
"      <td>",
"       Yes",
"      </td>",
"      <td>",
"       Common",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     ALA: 5-aminolevulinic acid (delta-aminolevulinic acid); PBG: porphobilinogen.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
