var title_f25_1_25628="Polarized and non-polarized dermoscopy";
var content_f25_1_25628=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=DERM%2F71894&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=DERM%2F71894&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Differences between polarized and non-polarized dermoscopy",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        &nbsp;",
"       </td>",
"       <td class=\"subtitle1\">",
"        Non-Polarized Dermoscopy",
"        <br/>",
"        (NPD)",
"       </td>",
"       <td class=\"subtitle1\">",
"        Polarized Dermoscopy",
"        <br/>",
"        (PD)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Technique",
"        </strong>",
"       </td>",
"       <td>",
"        Requires direct contact between the scope and the skin. Requires a liquid interface.",
"       </td>",
"       <td>",
"        Although PD can be used in either the contact or non-contact mode, and can be used with or without a liquid interface, using a liquid interface and direct contact provides superior image clarity.",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        <strong>",
"         Skin layers",
"        </strong>",
"       </td>",
"       <td>",
"        Superficial layers are better visualized than deeper layers.",
"       </td>",
"       <td>",
"        Deep layers of epidermis and papillary dermis (depth of polarized light ~60-100 &micro;m) are better visualized than superficial layers.",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"6\">",
"        <strong>",
"         Colors and structures",
"        </strong>",
"       </td>",
"       <td>",
"        Blue white-veil due to orthokeratosis is more conspicuous.",
"       </td>",
"       <td>",
"        Pink and red colors are more conspicuous.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Milia-like cysts and comedo-like structures are easier to recognize under NPD.",
"       </td>",
"       <td>",
"        Milia-like cysts and comedo-like structures are less conspicuous with PD.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        The steel-blue color seen in blue nevi appears more homogeneous under NPD.",
"       </td>",
"       <td>",
"        The blue color in blue nevi will appear darker with differing hues.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Regression areas (peppering, blue white areas and gray color) are more conspicuous with NPD.",
"       </td>",
"       <td>",
"        The white scar-like areas are more conspicuous under PD.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        The ability to visualize vascular structures is dependent upon the amount of pressure applied to the skin.",
"       </td>",
"       <td>",
"        Vascular structures and collagen are more conspicuous.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        White shiny&nbsp;streaks, also known as chrysalis/crystalline structures, are only seen under PD.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from:",
"     <br>",
"      <ol>",
"       <li>",
"        Pan Y, Gareau DS, Scope A, et al. Polarized and nonpolarized dermoscopy: the explanation for the observed differences. Arch Dermatol 2008; 144:828.",
"       </li>",
"       <li>",
"        Benvenuto-Andrade C, Dusza SW, Agero AL, et al. Differences between polarized light dermoscopy and immersion contact dermoscopy for the evaluation of skin lesions. Arch Dermatol 2007; 143:329.",
"       </li>",
"      </ol>",
"     </br>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
